import React, { useEffect, useState } from "react";
import axios from "axios";

const Tl = () => {
    const [nhansus, setNhansus] = useState([])
    const [chucvus, setChucvus] = useState([])
    const [tinhluong, setTinhluong] = useState({
        Idns: '',
        Ngay: '',
        Thang: '',
        Nam: '',
        luong: ''
    })
    useEffect(() => {
        axios.get('http://localhost:3000/nhansu')
            .then(Response => { if (Response.data) { setNhansus(Response.data); } else { alert(Response.data) } }).catch(err => console.log(err))
        axios.get('http://localhost:3000/chucvu')
            .then(Response => { if (Response.data) { setChucvus(Response.data); } else { alert(Response.data) } }).catch(err => console.log(err))

    }, []);

    const [tinhlungtacmo, setTinhlungtacmo] = useState(false)
    const [tableds, setTableds] = useState(true)
    const tacmotinhluong = () => {
        setTinhlungtacmo(!tinhlungtacmo);
        setTableds(!tableds)
    }

    return (
        <div>
            <h1>TÍNH LƯƠNG</h1>
            {tinhlungtacmo && (
                <div>
                    <form>
                        <div>
                            <label>Chức Vụ</label>
                            <input required type="text" onChange={(e) => setTinhluong({ ...tinhluong, Tenchucvu: e.target.value })} placeholder='Nhap Chucvu' /><br />
                            <label>Quyền Hạng Chức Vụ</label>
                            <input type='number' onChange={(e) => setTinhluong({ ...tinhluong, Quyenhang: e.target.value })} placeholder='Nhập Quyền Hạng'></input>
                            <span>Quyền Hạng này phân cấp cho chức vụ nhằm xác định chức vụ lớn hơn cao nhất là 1</span><br />
                            <label>Ghi Chú</label>
                            <input required type="text" onChange={(e) => setTinhluong({ ...tinhluong, Ghichu: e.target.value })} placeholder='Nhap Ghi Chú' /><br />
                        </div>
                        <button className='btn btn-success w-100 rounded-0 mb-2'>Tính</button>
                    </form>
                </div>
            )}
            <table className='table'>
                <thead>
                    <tr>
                        <th>Mã Nhân Viên</th>
                        <th>Tên</th>
                        <th>Chức Vụ</th>
                        <th>Tùy Chọn</th>

                    </tr>
                </thead>
                <tbody>
                    {
                        nhansus.map(e => (
                            <tr key={e._id}>
                                <td>{e.Hoten}</td>
                                <td>{e.Mnv}</td>
                                {/* Find the corresponding job position */}
                                {
                                    chucvus.find(c => c._id === e.Chucvu) ? (
                                        <td>{chucvus.find(c => c._id === e.Chucvu).Tenchucvu}</td>
                                    ) : (
                                        <td>Chưa Có Chức Vụ</td> // Display a message if job position not found
                                    )
                                }
                                <td className='td-tuychon'>
                                    <button onClick={() => tacmotinhluong(e.id)} className=''>Tính Lương</button>
                                    <button className='bt-chamlai'>Tính Lại</button>
                                </td>
                            </tr>
                        ))
                    }
                </tbody>
            </table>
        </div>
    );
}

export default Tl;
